import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          William Cragg
        </p>
        <p>
          Full-Stack Developer
        </p>
      </header>
    </div>
  );
}

export default App;
